  SELECT
  XML:"@ActionTS"::TIMESTAMP AS ACTION_DATE
  ,XML:"@ActionType"::STRING AS ACTION_TYPE
  ,XML:"$"."@C_ID"::NUMBER AS CUSTOMER_ID
